require 'pry'

def two_sum(numbers, target)
  first = 0
  second = 1

  # if target != 0 && numbers.length > 100
    short = numbers.uniq
  else
    short = numbers
  end
  
  binding.pry
  if numbers[first] > target || numbers[second] > target && numbers[first] != 0 && numbers[second] != 0 && numbers[first] > 0
    binding.pry
    first += 1
  else
    binding.pry
    until first > (short.length - 1)
      quantity = short.length - (first + 1)
      quantity.times do
        if short[first] + short[second] == target
          binding.pry
          if short[0] == 0 && target == 0
            short.drop(1)
            short.unshift('x')
            return [1, numbers.index(short[second])+ 1]
          else
            binding.pry
            return [numbers.index(short[first]) + 1, numbers.index(short[second])+ 1]
          end
        else
          second += 1
        end
      end
      first += 1
      second = first + 1
    end
  end
end

